<!DOCTYPE html>

<html lang="en">

<head>
    <meta charset="UTF-8">
    <style>
        @page {
            size: A4 landscape;  /* Landscape orientation */
            margin: 1cm;
        }
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
        }
        .header {
            text-align: center;
            margin-bottom: 20px;
        }
        .header h2 {
            position: absolute;
            font-size:20px;
            margin: 0;
            white-space: nowrap; /* Prevents title from wrapping */
        }
        .header img {
            width: 150px;
            height: auto;
        }
        .report-header {
            margin-left: 80px;
            margin-right: 100px;
            margin-bottom: 20px;
        }
        .report-header p {
            margin: 5px 0;
            font-size:14px;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 20px;
        }
        th, td {
            border: 1px solid #ddd;
            padding: 8px;
            text-align: left;
            word-wrap: break-word;
            font-size:12px;
        }
        th {
            background-color: #A6C788;
            font-weight: bold;
        }
        thead {
            display: table-header-group;
        }
        tfoot {
            display: table-footer-group;
        }
        tbody {
            display: table-row-group;
        }

        tr {
            page-break-inside: avoid;
            page-break-after: auto;
        }
    </style>
</head>
